import { useContext } from "react";
import style from "./ExpenseListModal.module.css";
import ExpenseList from "../ExpenseList/ExpenseList";
import ExpenseDataContext from "../../../store/expenseData/expenseData--context";
import SubTitle from "../SubTitle/SubTitle";

function ExpenseListModal(props) {
  const expenseDataCtx = useContext(ExpenseDataContext);

  return (
    <div>
      <SubTitle className={style.title}>2021-02-23</SubTitle>
    </div>
  );
}

export default ExpenseListModal;

